response.about:
Креативная концепция - это развернутое описание сути идеи. В данном случае мы рассматриваем креативную концепцию рекламной кампании, акции.

Размещая заказ на креативную концепцию, вы получаете:
- 3 варианта идеи;
- описание сути утвержденного варианта идеи;
- 3 варианта эскиза визуализации;
- рекомендации по использованию средств распространения рекламы;

 Шанс привлечь взгляды и обратить на себя внимание есть и у вашей фирмы. Креативная концепция позволяет компании работать продуманно, системно. Четко ставить задачи перед исполнителями (дизайнерами, сценаристами, режисерами и др.). Это описательный документ для рекламного производства. При готовой концепции ход подготовки рекламной кампании идет практически без форс-мажоров и срыва сроков. Эта услуга прежде всего необходима для компаний, которые имеют осознанную рекламную деятельность и строят именно Бренд. Здесь, под осознанностью понимается отношение руководства фирмы к рекламе не как к вынужденным и не регулярным пустым тратам, а как к инвестициям.

Что получает фирма от внедрения креативных концепции в свою рекламную деятельность? Вот далеко не полный список плюсов:
- узнаваемость;
- формирование репутации фирмы;
- формирование бренда;
- фокусировку позиционирования;
- привлечение внимания к фирме;
- отстройку от конкурентов;
- существенную экономию рекламного бюджета, до !! 60% !!

 Важно понимать, концепция - это описательный документ, в котором образы рассматриваются под разными “углами”. Это проект креативной (творческой, если хотите художественной) части плана рекламных мероприятий. Дополнительными услугами обычно идут: визуализация эскизов, название акции, идеи слоганов, медиа-планирование и пр., и осуществляются в соответствии с прайс-листом.

